import NewsItem from './NewsItem'

export class News extends Component {

    constructor() {
        super();
        this.state = {
            articles: this.articles,
            loading: false,
        };
    }
    render() {
        return (
            <div className='container my3'>
                <h2>DailyNews - Top Headline</h2>
                {this.state.articles.map((element)=>{console.log(element)})}
                <div className="row">
                    <div className="col-md-4">
                        <NewsItem title="mydoce" description="My description" imageUrl="https://s.yimg.com/ny/api/res/1.2/7_PFHDjiz24mY0pLGd9I8w--/YXBwaWQ9aGlnaGxhbmRlcjt3PTEyMDA7aD04MDA-/https://s.yimg.com/os/creatr-uploaded-images/2024-06/efef8f30-238d-11ef-9af7-63fec19364a0" />
                    </div>
                    <div className="col-md-4">
                        <NewsItem title="mydoce" description="My description" />
                    </div>
                    <div className="col-md-4">
                        <NewsItem title="mydoce" description="My description" />
                    </div>

                </div>
            </div>
        )
    }
}

export default News
